import React from "react";
import Resources1 from "../../Assets/Resouces1.png";

const Resources = () => {
  return (
    <div className=" my-24">
      <div className="flex flex-col items-center justify-center">
        <p className=" font-semibold  text-[40px] ">Resources</p>
        <div className="flex flex-col  w-[68.75rem] mt-10 mx-20">
          <div className="flex flex-col">
            <div className=" relative">
              <img
                src={Resources1}
                alt="Resource"
                className=" w-[360px] h-[480px] object-contain"
              ></img>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Resources;
